        g1 = PointDipoleList.from_string( string_2 )
        g2 = PointDipoleList.from_string( string_2 )

        a = g1.alpha( cython = False )
        a_cython = g2.alpha( cython = True, num_threads = 4 )
        np.testing.assert_allclose( a, a_cython )

